import React, { Component } from "react";
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
const styles = {
  mapStyles: {
    width: "96%"
  },
  mapContainer: {
    width: "50%",
    height: "26em"
  }
};
class RealMap extends Component {
  constructor(props){
    super(props);
  }

  render() {

    return <div className="">{this.props.lat}</div>;
  }
}

export default GoogleApiWrapper({
  apiKey: "AIzaSyDqV0nn953l7QAY_1GKVKcQO6Md2YW2W1o"
})(RealMap);
